:- module(iana, [iana/1,iana/2,iana/3]).

/** <module> IANA defined language list.
 *
 * All IANA language tags to be used in literal language assignment
 *
 * Taken from: "https://www.iana.org/assignments/language-subtag-registry/language-subtag-registry",
 * File-Date: "2022-08-08",
 *
 */

/* iana(?Language_Entry) is nondet.
 *
 * Language_Entry is a dict, with (some) of the following fields:
 *
 * Language_Entry = tag{
 *   type: "Type, % one of: language, script, region, redundant, variant",
 *   subtag: "Tag,",
 *   tag: "Tag,",
 *   description: "Description(s),",
 *   added: "Date",
 *   suppress_script: "Script",
 *   scope: "Scope,",
 *   prefix: "Prefix(s),",
 *   comments: "Comment,",
 *   preferred_value: "Tag,",
 *   deprecated: "Date",
 * }
 *
 * A language tag is of the form:
 * language-extlang-script-region-variant-extension-privateuse
 */

% iana(+Lang) is semidet.
%
% Check if this language exists.
iana(Lang) :-
    iana(Lang,_).

% iana(+LANG,-Record) is semidet.
%
% If language exists, return the records.
iana(Tag,[Record]) :-
    iana(grandfathered,Tag,Record),
    !.
iana(Tag,Records) :-
    split_string(Tag,'-','',List),
    maplist(atom_string,Parts,List),
    Types = [language,extlang,script,region,variant,extension,privateuse],
    findall(Record,
            (   member(Type,Types),
                member(Elt,Parts),
                once(iana(Type,Elt,Record))
            ),
            Records),
    % We better have gotten a record for each!
    length(Records,N),
    length(Parts,N).

